INSERT INTO ColonizationStages (stage_id, stage_name, stage_description) VALUES
(1,  'Pioneers', 					'A small group of people arrives at a new location and begins to settle the land. They build the first shelters, plant crops, and raise animals.'),
(2,  'Self-Sufficiency', 			'The colony becomes self-sufficient and can sustain itself without outside assistance. Agriculture, crafts, and local trade develop.'),
(3,  'Agrarian Export', 			'The colony begins to produce surpluses of agricultural products, which are exported to the metropolis or other regions. This leads to increased trade and prosperity for the colonists.'),
(4,  'Crafts Development', 			'Crafts and manufacturing develop in the colony. This leads to urban population growth and increased demand for goods and services.'),
(5,  'Trade Expansion', 			'The colony expands its trading network and begins to trade with other colonies and the metropolis. This results in increased wealth and influence for the colony.'),
(6,  'Colonial Trade Monopoly', 	'The metropolis establishes a monopoly on trade with the colony. This leads to increased economic inequality and tension between the colony and the metropolis.'),
(7,  'Industrial Revolution', 		'The colony undergoes an industrial revolution, transitioning from manual to machine labor. This leads to increased labor productivity, urban population growth, and worsening living conditions for workers.'),
(8,  'Industrial Growth', 			'The colony becomes a major industrial center. Heavy and light industry, transportation, and communication develop.'),
(9,  'Imperialism', 				'The colony itself may become an empire and seize other territories. This leads to increased power and influence on the world stage.'),
(10, 'Deindustrialization', 		'The colony begins deindustrialization, transitioning from industrial production to the service sector. This leads to a decrease in the number of workers and an increase in unemployment.'),
(11, 'Service Sector Development', 	'The service sector, including finance, education, healthcare, and tourism, develops in the colony. This leads to an increase in the number of white-collar workers and a greater role for information technology.'),
(12, 'Globalization', 				'The colony becomes part of the global economy and is interconnected with other regions of the world.');
